  [],\n\t\"revision_timestamp\": \"2015-07-08T19:24:56.905896\",\n\t\"name\": \"baltic-sea-experiment-baltex-ground-based-radar-polar-volume-data\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This data set includes non-Doppler polar
  volume reflectivity data from the Baltic Sea Experiment (BALTEX). Data were collected
  on Sweden's Gotland Island, using an Ericsson radar mounted at 56 m above sea level.
  The radar provided 12 scanning angles. Measurements were taken between 1 September
  2002 and 31 May 2003. BALTEX data sets will be used for validation of AMSR-E and
  Advanced Microwave Sounding Unit (AMSU)/Humidity Sounder for Brazil (HSB) Level
  1 brightness temperatures and Level 2 cloud and precipitation parameters. Data are
  available in network Common Data Format (netCDF) from NSIDC via FTP.nnThe Advanced
  Microwave Scanning Radiometer - Earth Observing System (AMSR-E) is a mission instrument
  launched aboard NASA's Aqua Satellite on 4 May 2002. The Baltic Sea Experiment's
  (BALTEX) Radar Data Centre (BRDC), operated by the Swedish Meteorological and Hydrological
  Institute (SMHI), collects data from as many radars in or near the Baltic region
  as possible. During the Main Observational Phase (October 1999 - February 2002),
  data from 25 radars in six countries have covered the Baltic region every 15 minutes.
  High-latitude data are recorded from 50 to 70 degrees North, and they complement
  pre-existing efforts in the mid-latitudes and tropics.\",\n\t\"license_title\":
